function mxUndoManager(a){this.size=(a!=null)?a:100;this.clear()}mxUndoManager.prototype=new mxEventSource();mxUndoManager.prototype.constructor=mxUndoManager;mxUndoManager.prototype.size=null;mxUndoManager.prototype.history=null;mxUndoManager.prototype.indexOfNextAdd=0;mxUndoManager.prototype.isEmpty=function(){return this.history.length==0};mxUndoManager.prototype.clear=function(){this.history=[];this.indexOfNextAdd=0;this.fireEvent(new mxEventObject(mxEvent.CLEAR))};mxUndoManager.prototype.canUndo=function(){return this.indexOfNextAdd>0};mxUndoManager.prototype.undo=function(){while(this.indexOfNextAdd>0){var a=this.history[--this.indexOfNextAdd];a.undo();if(a.isSignificant()){this.fireEvent(new mxEventObject(mxEvent.UNDO,"edit",a));break}}};mxUndoManager.prototype.canRedo=function(){return this.indexOfNextAdd<this.history.length};mxUndoManager.prototype.redo=function(){var b=this.history.length;while(this.indexOfNextAdd<b){var a=this.history[this.indexOfNextAdd++];a.redo();if(a.isSignificant()){this.fireEvent(new mxEventObject(mxEvent.REDO,"edit",a));break}}};mxUndoManager.prototype.undoableEditHappened=function(a){this.trim();if(this.size>0&&this.size==this.history.length){this.history.shift()}this.history.push(a);this.indexOfNextAdd=this.history.length;this.fireEvent(new mxEventObject(mxEvent.ADD,"edit",a))};mxUndoManager.prototype.trim=function(){if(this.history.length>this.indexOfNextAdd){var a=this.history.splice(this.indexOfNextAdd,this.history.length-this.indexOfNextAdd);for(var b=0;b<a.length;b++){a[b].die()}}};